import{_ as a,o as e,c as t,S as o}from"./chunks/framework.a3dd33a8.js";const m=JSON.parse('{"title":"操作指南","description":"","frontmatter":{},"headers":[],"relativePath":"base/product/DDD可视化开发平台文档/操作指南.md","filePath":"base/product/DDD可视化开发平台文档/操作指南.md","lastUpdated":1706585121000}'),r={name:"base/product/DDD可视化开发平台文档/操作指南.md"},c=o('<h1 id="操作指南" tabindex="-1">操作指南 <a class="header-anchor" href="#操作指南" aria-label="Permalink to &quot;操作指南&quot;">​</a></h1><blockquote><p><em>用户权限说明</em></p><p>用户根据不同权限可以分为系统管理员、组织管理员、团队管理员和团队成员：</p><p>系统管理员：系统管理者，拥有账号管理、组织创建的权限；</p><p>组织管理员：组织管理者，由系统管理员分配，拥有所属组织的管理权限；同时拥有组织下创建和关联团队的权限；</p><p>团队管理员：团队管理者，由组织管理员分配，拥有所属团队的管理权限；同时拥有团队下添加团队成员的权限；</p><p>团队成员：团队中的成员，由团队管理员分配，拥有所属团队的空间访问权限，可以进入对应团队空间进行开发；</p><p>普通用户：暂未加入任何团队的用户，拥有Chat聊天窗口的访问权限及初始化的个人空间；</p></blockquote><h2 id="平台和项目管理" tabindex="-1"><a href="./操作指南/平台和项目管理.html">平台和项目管理</a> <a class="header-anchor" href="#平台和项目管理" aria-label="Permalink to &quot;[平台和项目管理](操作指南/平台和项目管理.md)&quot;">​</a></h2><blockquote><p>描述：平台和项目管理模块提供了系统管理、组织团队管理和项目应用管理等子模块， 帮助管理员管理系统配置、组织以及项目的需求设计和代码开发等功能支持。</p></blockquote><h2 id="业务建模平台" tabindex="-1"><a href="./操作指南/业务建模平台.html">业务建模平台</a> <a class="header-anchor" href="#业务建模平台" aria-label="Permalink to &quot;[业务建模平台](操作指南/业务建模平台.md)&quot;">​</a></h2><blockquote><p>描述：业务建模平台是一种帮助团队成员理解和描述业务流程、决策点以及各部门之间沟通和协作的工具。</p></blockquote><h2 id="应用开发平台" tabindex="-1"><a href="./操作指南/应用开发平台.html">应用开发平台</a> <a class="header-anchor" href="#应用开发平台" aria-label="Permalink to &quot;[应用开发平台](操作指南/应用开发平台.md)&quot;">​</a></h2>',7),l=[c];function d(h,p,s,_,n,i){return e(),t("div",null,l)}const b=a(r,[["render",d]]);export{m as __pageData,b as default};
